import React from 'react';

export default class Home extends React.Component{
    constructor(props){
        super(props);
        this.state={
            places:["mumbai","goa","pune","hyderabad"]
        }
    }
    render(){
        return(
            <div>
                <p>
                    {this.state.places.map((place) =>
                    <p>{place}</p>
                    )}
                </p>

            </div>
        )
    }
}
